import React, { useState } from 'react';
import { Link, useLocation } from 'react-router-dom';
import './CustHeader.css';
import ShinyText from './ShinyText';

const CustHeader = () => {
  const [isOpen, setIsOpen] = useState(false);
  const location = useLocation();

  const navItems = [
    { path: '/homecust/homecust', label: 'Home', icon: '🏠' },
    { path: '/homecust/sellwaste', label: 'Sell Waste', icon: '♻️' },
    { path: '/homecust/history', label: 'History', icon: '📜' },
    { path: '/homecust/dashboard', label: 'Dashboard', icon: '📊' }
  ];

  return (
    <nav className="navbar">
      <div className="navbar-container">
        <div className="navbar-brand">
          <span className="brand-icon">🌍</span>
          <ShinyText text="Agri Waste" disabled={false} speed={3} className='custom-class brand-name' />
        </div>

        <button
          className={`hamburger ${isOpen ? 'active' : ''}`}
          onClick={() => setIsOpen(!isOpen)}
          aria-label="Toggle navigation"
        >
          <span className="hamburger-line"></span>
          <span className="hamburger-line"></span>
          <span className="hamburger-line"></span>
        </button>

        <div className={`navbar-menu ${isOpen ? 'active' : ''}`}>
          <ul className="nav-list">
            {navItems.map(({ path, label, icon }) => (
              <li key={path} className="nav-item">
                <Link
                  to={path}
                  className={`nav-link ${location.pathname === path ? 'active' : ''}`}
                  onClick={() => setIsOpen(false)}>
                  <h5>
                    <span className="nav-icon">{icon}</span>
                    <span className="nav-label">{label}</span>
                  </h5>
                </Link>
              </li>
            ))}
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default CustHeader;
